// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract OrderPaymentEscrow {

    address public owner;

    // Enum to represent payment status
    enum PaymentStatus { Pending, Paid }
    // Enum to represent delivery status
    enum DeliveryStatus { Pending, Delivered }

    // Struct to represent an order
    struct Order {
        uint256 orderId;
        uint256 productId;
        uint256 buyerId;
        uint256 quantity;
        uint256 price;
        PaymentStatus paymentStatus;
        DeliveryStatus deliveryStatus;
        uint256 orderDate;
        uint256 farmer_id;
        address buyer;
    }

    mapping(uint256 => Order) public orders;
    mapping(uint256 => string) public orderTxHash;

    event OrderPaid(uint256 orderId, uint256 amount, address buyer, string transactionHash);

    constructor() {
        owner = msg.sender;  // Contract owner (can be the marketplace or seller)
    }

    // Function to create an order (not required in this case, as orders are created on backend)
    function createOrder(
        uint256 orderId, 
        uint256 productId, 
        uint256 buyerId, 
        uint256 quantity, 
        uint256 price, 
        uint256 farmer_id, 
        address buyer
    ) external {
        require(msg.sender == owner, "Only the contract owner can create orders.");
        orders[orderId] = Order(
            orderId, 
            productId, 
            buyerId, 
            quantity, 
            price, 
            PaymentStatus.Pending, 
            DeliveryStatus.Pending, 
            block.timestamp, 
            farmer_id, 
            buyer
        );
    }

    // Function to handle payment, this will be triggered by the backend
    function payForOrder(uint256 orderId) external payable {
        Order storage order = orders[orderId];
        require(order.orderId != 0, "Order does not exist.");
        require(order.paymentStatus == PaymentStatus.Pending, "Order already paid.");
        require(msg.value == order.price, "Incorrect payment amount.");

        order.paymentStatus = PaymentStatus.Paid;
        
        string memory txHash = "SomeTransactionHash"; // Replace this with actual tx hash from Web3.js
        orderTxHash[orderId] = txHash;

        emit OrderPaid(orderId, msg.value, msg.sender, txHash);
    }

    // Function to release the payment to the farmer after delivery (not implemented here, but follows the same process)
    function deliverOrder(uint256 orderId) external {
        Order storage order = orders[orderId];
        require(order.paymentStatus == PaymentStatus.Paid, "Payment not received.");

        order.deliveryStatus = DeliveryStatus.Delivered;
        payable(owner).transfer(order.price);  // Transfer the payment to the farmer (or contract owner)
    }
}
